async function unlock(){
const pw=document.getElementById('pw').value;
const err=document.getElementById('err');
err.style.display='none';
try{
const salt=Uint8Array.from(atob(D.salt),c=>c.charCodeAt(0));
const nonce=Uint8Array.from(atob(D.nonce),c=>c.charCodeAt(0));
const ct=Uint8Array.from(atob(D.ciphertext),c=>c.charCodeAt(0));
const enc=new TextEncoder();
const keyMaterial=await crypto.subtle.importKey('raw',enc.encode(pw),'PBKDF2',false,['deriveBits','deriveKey']);
const key=await crypto.subtle.deriveKey({name:'PBKDF2',salt:salt,iterations:100000,hash:'SHA-256'},keyMaterial,{name:'AES-GCM',length:256},false,['decrypt']);
const decrypted=await crypto.subtle.decrypt({name:'AES-GCM',iv:nonce},key,ct);
const html=new TextDecoder().decode(decrypted);
document.open();document.write(html);document.close();
}catch(e){err.style.display='block';document.getElementById('pw').value='';document.getElementById('pw').focus()}
return false;
}
</script>
